The Incredible Journey of the Butterflies (PBS)

Nature Documentary hosted by Stockard Channing, published by PBS in 2009 - English narration


Information
------------------------------

Every year, 100 million Monarch butterflies set off on an incredible journey across North America. These graceful creatures fly 2,000 miles to reach their remote destination: a tiny area high in the mountains of Mexico. Yet scientists still puzzle over how the butterflies accomplish this tremendous feat of endurance - and how, year after year, the Monarchs navigate with such hair's-breadth precision. In its 36th season opener, Nova flies along with the Monarchs, visiting the spectacular locations they call home and meeting the dangers they encounter along the way. The journey reveals the Monarch to be a scientific marvel locked in an inspiring struggle for survival.

